import React, {Component} from 'react';
import {Button, Form, Container} from "react-bootstrap";

class Login extends Component {
    constructor(props) {
        super(props);
        this.state = {
            login: null,
            haslo: null
        };
    }
    render() {
        return (
            <Container>
            <div className="login-in-page">
                <Form action={"http://localhost:8081/pracownik/log"} method="get" className="towcud">
                    <Form.Label>Login</Form.Label>
                    <Form.Control type="input" placeholder="Login" name="login" />
                    <Form.Label>Haslo</Form.Label>
                    <Form.Control type="input" placeholder="Haslo" name="haslo"/>
                    <Button variant="outline-info" type="submit" className="pozcud mt-3"> LogIn </Button>
                </Form>
            </div>
            </Container>
        );
    }
}

export default Login;
